Nota van de Staten-Generaal aan de Staten van Holland over het gesprek van de gedeputeerden die in opdracht van de Staten-Generaal, de Admiraal-Generaal en de Raad van State met burgemeesteren van Amsterdam over
- het oprichten van een permanent college tot directie van de kustschepen;
- het verpachten van convooien en licenten;
- het oprichten van een Kamer van Assurantie;
- het handeldrijven op en het gebruik van schepen door de vijand; afschrift.

Memorie van antwoord van burgemeesteren van Amsterdam aan de Staten van Holland inzake het overleg met gedeputeerden van de Staten-Generaal en de Raad van State over
- het oprichten van een permanent college tot directie van de kustschepen;
- het verpachten van convooien en licenten;
- het oprichten van een Compagnie van Assurantie;
- het handeldrijven op en het gebruik van schepen door de vijand; afschrift.
